import React from "react";

export function LastName() {
  return (
    <form>
      <div class="form-group row">
        <label for="lastName" class="col-sm-2 col-form-label">
          Last Name
        </label>
        <div class="col-sm-10">
          <input
            type="lastName"
            class="form-control"
            id="lastName"
            placeholder="Last Name"
          />
        </div>
      </div>
    </form>
  );
}
